import React from 'react';
import './Home.css';

function Home() {
  return (
    <div id="home">
      <div className="menu-container">
        <button className="ten-paths btn btn-primary">
          <h1>10 Paths</h1>
        </button>
        <button className="sandbox">
          <h1>Sandbox</h1>
        </button>
        <button className="multiplayer">
          <h1>Multiplayer</h1>
        </button>
      </div>
    </div>
  );
}

export default Home;
